    let color = props.color;
    let station = props.station;
    return (<div>
        {arrivals["RailArrivals"].map( (arrival) => {
            if (arrival.LINE === color) {
                //Also make sure station is correct
                return (<Train {...arrival}/>)
            }
        })}
    </div>);
}
